A type proxy can be defined as a kind of library of static constants and methods. The NumberProxy is just such a proxy. Numbers have no methods in Joe, and they do not need an initializer as they can be typed directly into a script. In this case, the type can be declared to be a static type . Among other things, this means that attempts to create an instance using the type's initializer will get a suitable error message. public class NumberProxy extends TypeProxy<Double> { public NumberProxy() { super("Number"); staticType(); proxies(Double.class); ... } ...
} In the case of the Number type, the proxy still proxies an actual data type. This need not be the case. It is common to define a static type as a named library of functions with no related Java type. For example, consider a library to convert between Joe values and JSON strings. It might look like this: public class JSONProxy extends TypeProxy<Void> { public JSONProxy() { super("JSON"); staticType(); staticMethod("toJSON", this::_toJSON); staticMethod("fromJSON", this::_fromJSON); ... } ...
}

